from collections import Counter

mod = 10**9 + 7

def get_n(s: str):
    len_s = len(s)
    if len_s == 1:
        return 1
    cnt = 0
    for i in range(1, len_s + 1):
        cnt += i
    return cnt


class Solution:
    def numSub(self, s: str) -> int:
        lst = [c for c in s.split("0") if c]
        if not lst:
            return 0
        # print(lst)
        cd = Counter(lst)
        ans = 0
        for k, v in cd.items():
            ans += get_n(k) * v
        return ans % mod


if __name__ == '__main__':
    S = Solution()
    x = ""
    print(S.numSub(x))